description:
Bán nhà mặt phố Trần Kim Xuyến, Cầu Giấy: 
- Diện tích 100m2 x 5 tầng + tầng hầm, MT 5m. Thang máy.Hai mặt thoáng. SĐCC. 
- Mặt phố rộng, Vỉa hè 3m, vị trí đẹp. Kinh doanh cực kỳ sầm uất. Là phố nối phố Trung Hòa thông ra Trần Duy Hưng, Trung Kính đôi, Hà Yên. Nhà thuộc khu đô thị Yên Hòa nên đất vuông vắn. Khu vực dành cho các lãnh đạo cấp cao ở nên dân trí rất cao.
- Phù hợp kinh doanh, làm văn phòng, ngân hàng, khách sạn,...  đang cho thuê kinh doanh 3000usd/th;
- Hướng TN; 
- Gía 38 tỷ.
